window.bookSummaryJSON = "<p><b>The #1 </b><b><i>New York Times</i></b><b> bestselling author of </b><b><i>Year One</i></b><b> and </b><b><i>Of Blood and Bone </i></b><b>concludes her stunning new trilogy praised as “A match for end-of-the-world classics like Stephen King’s </b><b><i>The Stand</i></b><b>.</b>”</p> <p>After the sickness known as the Doom destroyed civilization, magick has become commonplace, and Fallon Swift has spent her young years learning its ways. Fallon cannot live in peace until she frees those who have been preyed upon by the government or the fanatical Purity Warriors, endlessly hunted or locked up in laboratories, brutalized for years on end. She is determined to save even those who have been complicit with this evil out of fear or weakness - if, indeed, they can be saved.</p> <p>Strengthened by the bond she shares with her fellow warrior, Duncan, Fallon has already succeeded in rescuing countless shifters and elves and ordinary humans. Now she must help them heal - and rediscover the light and faith within themselves. For although from the time of her birth, she has been The One, she is still only one. And as she faces down an old nemesis, sets her sights on the enemy’s stronghold, and pursues her destiny - to finally restore the mystical shield that once protected them all - she will need an army behind her....</p>"; 
